        let checkedBoxes = $('.OOMchk:Checked');
        let totalButtonsWidth = 0;
        for(let i=0; i<checkedBoxes.length;i++){
            totalButtonsWidth += parseInt($(`label[for='${$(checkedBoxes[i]).attr('id')}'] img`).css('width').slice(0,-2));
        }
